import styled from 'styled-components';

export default styled.button`
  width: 100%;
  padding: 0.9rem 0.1rem;
  background: #ffa640;
  border: none;
  border-radius: 6.25rem;
  font-size: 0.88rem;
  color: #ffffff;
  font-weight: 600;
  letter-spacing: 0.26rem;
  cursor: pointer;
`;
